Legion of Super-Heroes v4 #65-70
Publisher:  DC Comics
Publication Date:  December 13, 1994 - May 9, 1995

Writers:  Tom McCraw (#65-70), Mark Waid (#65-70), and Tom Peyer (#65, 67-70)
Pencillers:  Lee Moder (#65-66, 68-69), Chris Renaud (#67), and Jason Armstrong (#70)
Inkers:  Ron Boyd
COlorist:  Tom McCraw
Letterer:  Bob Pinaha
Cover Artists:  Lee Moder (#65-66), Matt Haley (#67), Alan Davis (#68-70), Ron Boyd (#66), Tom Simmons (#67), Mark Farmer (#68-70), and Tom McCraw (#65-70)

Legion of Super-Heroes #65
A mass jailbreak occurs on a vast maximum-security prison planet. In the thick of the ensuing riot, nine stranded Legionnaires struggle to survive against thousands of the most dangerous criminals in the galaxy. 

Legion of Super-Heroes #66
The United Planets government forces new and more powerful heroes into the Legion, among them a bitter young teenager from the planet Daxam--who may turn out to be the Legion's biggest nightmare. 

Legion of Super-Heroes #67
Leviathan embarks on a mission of vengeance, taking the Legion's most powerful members with him and leaving the rest of the team shorthanded. 

Legion of Super-Heroes #68
The Legionnaires tussle with spider-creatures, while Invisible Kid tries to rescue Cosmic Boy and Spark from Tangleweb. 

Legion of Super-Heroes #69
A Legionnaire makes a terrifying sacrifice to save the team from a rampaging Durlan who possesses all the powers of the 30th century's greatest heroes. 

Legion of Super-Heroes #70
Andromeda will die within a day unless Brainiac 5 can develop a serum to counter her lead poisoning. Plus, the Legion's partnership with the United Planets begins to disintegrate when one Legionnaire is unmasked as a traitor.

Thanks goes to DreamGirl for this release.

